import React from 'react'
import '../css/style.css'
import Nav from 'react-bootstrap/Nav';

import 'bootstrap/dist/css/bootstrap.min.css';

const Nave  = () => {

    return ( 
        <div>
    <img className = 'imgt' src="./images/logo.webp" alt=""/>

        <Nav defaultActiveKey="/home" className="flex-column">
  <Nav.Link className = 'text-' href="/home">Home</Nav.Link>
  <Nav.Link className = 'text-' eventKey="link-1">About</Nav.Link>
  <Nav.Link className = 'text-' eventKey="link-2">Services</Nav.Link>
  <Nav.Link className = 'text-' eventKey="link-3">Portfolio</Nav.Link>
  <Nav.Link className = 'text-' eventKey="link-4">Contact</Nav.Link>
</Nav>
</div>

                )}

export default Nave
